import React from 'react';

export default function Card(props) {
  console.log('Card props', props);
  return (
    <div>
      <h1>{props.name}</h1>
      <p>
        {props.about} and I am {props.age} years old
      </p>
      <button onSubmit={props.deleteUser(props.key)}>Delete User</button>
    </div>
  );
}
